INSERT INTO `products` VALUES (1,'Plastic Pot','Made of durable plastic material, suitable for indoor and outdoor use.','variable',4,'2024-07-12 08:31:51','2024-07-12 08:31:51'),(2,'Clay Pot','Crafted from natural clay, provides good breathability for plant roots.','variable',4,'2024-07-12 08:31:51','2024-07-12 08:31:51'),(3,'Ceramic Pot','Elegant ceramic design, ideal for decorative purposes indoors.','variable',4,'2024-07-12 08:31:51','2024-07-12 08:31:51'),(4,'Plastic Container','Sturdy plastic container suitable for planting various types of plants.','variable',5,'2024-07-12 08:33:23','2024-07-12 08:33:23'),(5,'Wooden Planter','Handcrafted wooden planter for a natural look in your garden.','variable',5,'2024-07-12 08:33:23','2024-07-12 08:33:23'),(6,'Metal Planter','Durable metal pot with drainage holes for optimal plant health.','variable',5,'2024-07-12 08:33:23','2024-07-12 08:33:23'),(7,'The Garden Against Time: In Search of a Common Paradise','Inspired by the restoration of her own garden, \"imaginative and empathetic critic\" (NPR) Olivia Laing embarks on an exhilarating investigation of paradise.','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(8,'The Old Farmer`s Almanac Vegetable Gardener`s Handbook (Old Farmer`s Almanac (Paperback))','The Old Farmer`s Almanac, founded in 1792, has a strong presence in the gardening information field that includes such products as the annual Garden Guide (available in both print and digital formats), the Garden Planner (an interactive online resource for planning and recording garden activities), the Gardening calendar (a perennial favorite of gardeners and nature lovers for more than 45 years that has been the #1 best-seller in garden calendars on Amazon), and the Gardening Club (a membership opportunity that offers people a selection of Old Farmers','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(9,'The Complete Gardener: A Practical, Imaginative Guide to Every Aspect of Gardening','The most comprehensive, practical, and highly illustrated book Monty has ever written, it covers what he believes are the most important aspects of gardening. Organic techniques have always been at the core of his practice, but this new edition picks up on another key principle: the need to provide habitats in your garden for local wildlife.','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(10,'Seed to Table: A Seasonal Guide to Organically Growing, Cooking, and Preserving Food at Home (Kitchen Garden, Urban Gardening)','Gardening, cooking, and eating done right! Seed to Table focuses on how to feed your family with nutritious foods from your own outdoor, home and/or kitchen garden. Whether you live in a city or in the country, this book gives you tools on effective growing techniques, seed starting methods, and garden maintenance.','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(11,'Floret Farm`s Cut Flower Garden: Grow, Harvest, and Arrange Stunning Seasonal Blooms (Floret Farms x Chronicle Books)','\"Among a sea of new florists and floral books, Floret Flowers stands out. Erin Benzakein`s integrity, openness and passion for flowers is unmistakable. In her debut book she not only introduces us to the basics of growing our own flowers, she shares her deep love and understanding of gardening in a way that will leave even the most doubtful grower feeling inspired to get their hands in the dirt.\"Grace Bonney, founder of Design*Sponge and author of In the Company of Women','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(12,'The Complete Gardener`s Guide: The One-Stop Guide to Plan, Sow, Plant, and Grow Your Garden','Dreaming of having the perfect garden? Does it have a vegetable patch? Classic borders or flowers to attract wildlife? A picturesque garden for all to marvel at is achievable with this gardening guide, which gives you vital tools to achieve whatever you desire for your dream garden. ','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(13,'Raised-Bed Gardening for Beginners: Everything You Need to Know to Start and Sustain a Thriving Garden','Are you interested in creating a bountiful garden but worried that you don`t have enough space? Raised-Bed Gardening for Beginners shows you how simple it can be to plan, build, and grow your own raised-bed garden in whatever space is available. Learn to build your bed, select the right plants, grow your own vegetables, and much more. This book makes it easy for even inexperienced gardeners to serve up freshly picked vegetables and herbs in no time.','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(14,'All New Square Foot Gardening, 3rd Edition, Fully Updated: MORE Projects - NEW Solutions - GROW Vegetables Anywhere','Since Square Foot Gardening was first introduced by Mel Bartholomew in 1981, this revolutionary way to grow vegetables has helped millions of home gardeners enjoy their own organic, fresh produce in less space and with less work than traditional row gardens.','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(15,'The Ultimate Raised Bed & Container Gardening Guide For Beginners: Grow Your Own Vegetables, Herbs, Fruits, and Cut Flowers with this Amazing Handbook ... Family, Fertility, and Maternal Wellness','Welcome to the lush and vibrant world of raised bed and container gardening! Whether you`re a city dweller with limited outdoor space, a suburbanite looking to maximize your backyard, or just someone who enjoys the convenience of portable plots, \"The Ultimate Raised Bed & Container Gardening Guide For Beginners\" is your key to unlocking the joy and benefits of homegrown produce and blooms.','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(16,'The Drunken Botanist: The Plants that Create the Worlds Great Drinks: 10th Anniversary Edition','The New York Times-bestselling guide to botany and booze celebrates its 10th anniversary with an updated editionnow including a guide to planting your very own cocktail garden to go with more than fifty drink recipes. This fascinating, go-to text about the plants that make our drinks is the ideal gift book for every cocktail aficionado, the perfect drinks book for every plant-lover.','variable',2,'2024-07-14 10:00:02','2024-07-14 10:00:02'),(17,'Garden Shovel','Heavy-duty garden shovel for all your digging needs.','variable',6,'2024-07-14 10:07:11','2024-07-14 10:07:11'),(18,'Hand Trowel','Perfect for small digging tasks in the garden.','variable',6,'2024-07-14 10:07:11','2024-07-14 10:07:11'),(19,'Garden Hoe','Versatile garden hoe for digging and weeding.','variable',6,'2024-07-14 10:07:11','2024-07-14 10:07:11'),(20,'Bulb Planter','Specialized tool for planting bulbs with ease.','variable',6,'2024-07-14 10:07:11','2024-07-14 10:07:11'),(21,'Spading Fork','Sturdy spading fork for turning and aerating soil.','variable',6,'2024-07-14 10:07:11','2024-07-14 10:07:11'),(22,'Pruning Shears','Sharp pruning shears for precise cutting.','variable',7,'2024-07-14 10:07:20','2024-07-14 10:07:20'),(23,'Lopping Shears','Ideal for cutting thicker branches.','variable',7,'2024-07-14 10:07:20','2024-07-14 10:07:20'),(24,'Hedge Trimmer','Electric hedge trimmer for easy maintenance.','single',7,'2024-07-14 10:07:20','2024-07-14 10:07:20'),(25,'Pruning Saw','Compact pruning saw for cutting larger branches.','single',7,'2024-07-14 10:07:20','2024-07-14 10:07:20'),(26,'Flower Scissors','Perfect for trimming flowers and small plants.','variable',7,'2024-07-14 10:07:20','2024-07-14 10:07:20'),(27,'Garden Hose','Flexible garden hose for all your watering needs.','single',8,'2024-07-14 10:07:30','2024-07-14 10:07:30'),(28,'Watering Can','Classic watering can for precise watering.','variable',8,'2024-07-14 10:07:30','2024-07-14 10:07:30'),(29,'Sprinkler','Automatic sprinkler system for even watering.','single',8,'2024-07-14 10:07:30','2024-07-14 10:07:30'),(30,'Soaker Hose','Efficient soaker hose for deep root watering.','single',8,'2024-07-14 10:07:30','2024-0