ase RTU Trigger Pest Controller</p>','variable',20,'2024-07-17 00:56:55','2024-07-17 00:56:55'),(106,'Insect, Disease and Mite Control','<p>Insect, Disease and Mite Control</p>','variable',20,'2024-07-17 01:00:15','2024-07-17 01:00:15'),(107,'Plant and Garden Pest Control Spray','<p>Plant and Garden Pest Control Spray</p>','variable',20,'2024-07-17 01:02:58','2024-07-17 01:02:58'),(108,'Horticultural Oil Spray','<p>Horticultural Oil Spray</p>','variable',21,'2024-07-17 01:09:41','2024-07-17 01:09:41'),(109,'Insecticidal Soap','<p>Insecticidal Soap</p>','variable',21,'2024-07-17 01:12:09','2024-07-17 01:12:09'),(110,'Insect Control','<p>Insect Control</p>','variable',21,'2024-07-17 01:15:20','2024-07-17 01:15:20'),(111,'Fruit Tree & Vegetable Systemic Soil Drench','<p>Fruit Tree &amp; Vegetable Systemic Soil Drench</p>','variable',21,'2024-07-17 01:29:02','2024-07-17 01:29:02'),(112,'Vegetable Oil Spray','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">Homemade, natural pesticide made from vegetable oil mixed with a mild soap (such as </span>Dr. Bronner\'s Castile soap<span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">) can have a devastating effect on certain troublesome insects, such as aphids, mites, thrips, etc.</span></p>','variable',22,'2024-07-17 01:49:32','2024-07-17 01:49:32'),(113,'Soap Spray','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">A very similar homemade, natural pesticide to the oil spray is a soap spray, which is also effective for controlling spider mites, aphids, scale crawlers, mealybugs, whiteflies, beetles, and other hungry insects.</span></p>','variable',22,'2024-07-17 01:50:29','2024-07-17 01:50:29'),(114,'Neem Oil Spray','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">An oil extracted from the seeds of the neem tree is a powerful natural pesticide, capable of disrupting the life cycle of insects at all stages (adult, larvae, and egg), making it a great resource for the organic gardener.</span></p>','variable',22,'2024-07-17 01:51:23','2024-07-17 01:51:23'),(115,'Diatomaceous Earth','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">This natural substance with a somewhat unwieldy name is made from a sedimentary rock created by fossilized algae (diatoms), and which is a rather abundant resource (diatomaceous earth is said to make up 26 percent of the earth\'s crust by weight).</span></p>','variable',22,'2024-07-17 01:57:35','2024-07-17 01:57:35'),(116,'Garlic Spray','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">Garlic is well-known for its pungent aroma, which is delectable to some and yet repellent to others, and it is this strong scent that comes into play when used as a natural pesticide. Actually, it\'s not really clear if garlic spray and chile spray (below) are actually insecticides or are more likely insect repellents, but either way, these common kitchen ingredients can be used to knock down, or even knock out, insect infestations in the garden.</span></p>','variable',22,'2024-07-17 01:58:36','2024-07-17 01:58:36'),(117,'Chile Pepper Spray','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">Similar to garlic spray, chile pepper spray is a great homemade, natural insect repellent that can be used for a variety of different pests. Chile spray can be made from either fresh hot peppers or chile pepper powder.</span></p>','variable',22,'2024-07-17 01:59:41','2024-07-17 01:59:41'),(118,'All-in-One Homemade Spray','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">From the folks at Rodale\'s Organic Life comes this all-in-one DIY natural pesticide, which is said to be a combination of many different recipes submitted by readers.</span></p>','variable',22,'2024-07-17 02:00:37','2024-07-17 02:00:37'),(119,'Tomato Leaf Spray','<p><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\">Tomato plants are part of the nightshade family, and as such, contain alkaloids such as the aptly named \"tomatine,\" which can effectively control aphids and other insects.</span><span style=\"background-color:rgb(235,235,243);color:rgb(40,40,40);\"><strong>5</strong></span><span style=\"background-color:rgb(255,255,255);color:rgb(57,56,69);\"> To make tomato leaf spray for a natural pesticide, chop two cups of fresh tomato leaves (which can be taken from the bottom part of the plant) into one quart of water, and let steep overnight. Strain out the plant material and spray onto plant foliage.</span></p>','variable',22,'2024-07-17 02:01:24','2024-07-17 02:01:24'),(120,'Mini Dragon Playing with Ladybug Statue','<p>Mini Dragon Playing with Ladybug</p>','single',24,'2024-07-17 02:08:45','2024-07-17 02:25:51'),(121,'Mini Red Dragon Playing with Butterfly Statue','<p>Mini Red Dragon Playing with Butterfly</p>','single',24,'2024-07-17 02:10:02','2024-07-17 02:26:07'),(122,'Frog Reading Book on Turtle Statue','<p>Frog Reading Book on Turtle Statue</p>','single',24,'2024-07-17 02:11:36','2024-07-17 02:11:36'),(123,'Mini Dragon Statue','<p>Mini Dragon Statue</p>','single',24,'2024-07-17 02:18:48','2024-07-17 02:18:48'),(124,'Frog Flower Pot Hugger Figurines','<p>Frog Flower Pot Hugger Figurines</p>','single',24,'2024-07-17 02:20:04','2024-07-17 02:20:04'),(125,'Mini Dragon Reading Figurine','<p>Mini Dragon Reading Figurine</p>','single',24,'2024-07-17 02:22:36','2024-07-17 02:22:36'),(126,'Mini Dragon Roaring Statue','<p>Mini Dragon Roaring Statue</p>','single',24,'2024-07-17 02:24:14','2024-07-17 02:24:14'),(127,'Mini Dragons Cuddling Figurine','<p>Mini Dragons Cuddling Figurine</p>','single',24,'2024-07-17 02:25:26','2024-07-17 02:25:26'),(128,'Natural Decorative White Bean Pebbles','<p>Natural Decorative White Bean Pebbles</p>','variable',25,'2024-07-17 02:38:02','2024-07-17 02:38:02'),(129,'River Rock','<p>River Rock</p>','variable',25,'2024-07-17 02:44:07','2024-07-17 02:44: